const columns = [{
  title: "ID",
  field: "id",
  width: 60,
  hozAlign: "center",
  responsive: 0
}, {
  title: "Channel Name (Unit)",
  field: "name",
  headerFilter: "input",
  editor: "input",
  resizable: true,
  responsive: 0,
  width: 150,
  hozAlign: "center",
  validator: "required"
}, {
  title: "Color",
  field: "color",
  width: 120,
  hozAlign: "center",
  validator: "required",
  formatter: cell => {
    const v = cell.getValue() || "#888888";
    return `<input type="color" value="${v}" class="w-10 h-6 border-none cursor-pointer p-0 rounded focus:outline-none" />`;
  },
  cellClick: (e, cell) => {
    if (e.target.tagName === "INPUT" && e.target.type === "color") {
      e.target.addEventListener("change", evt => cell.setValue(evt.target.value), {
        once: true
      });
    }
  }
}, {
  title: "Unit",
  field: "unit",
  editor: "input",
  responsive: 1,
  width: 150,
  hozAlign: "center",
  validator: "numeric"
}, {
  title: "Group",
  field: "group",
  responsive: 1,
  width: 150,
  hozAlign: "center",
  editor: "list",
  editorParams: {
    autocomplete: true,
    allowEmpty: true,
    listOnEmpty: true,
    values: {
      "Group 1": "Group 1",
      "Group 2": "Group 2",
      "Group 3": "Group 3"
    }
  }
}, {
  title: "Scale",
  field: "scale",
  editor: "input",
  headerSort: true,
  responsive: 2,
  width: 150,
  hozAlign: "center",
  validator: "numeric"
}, {
  title: "Start",
  field: "start",
  editor: "input",
  responsive: 2,
  width: 150,
  hozAlign: "center",
  validator: "numeric"
}, {
  title: "Duration",
  field: "duration",
  editor: "input",
  responsive: 1,
  hozAlign: "center",
  width: 150,
  validator: "numeric"
}, {
  title: "Invert",
  field: "invert",
  hozAlign: "center",
  responsive: 1,
  width: 150,
  formatter: cell => {
    const value = cell.getValue() === true || cell.getValue() === "true";
    const checked = value ? "checked" : "";
    return `
          <label class="inline-flex items-center cursor-pointer relative">
            <input type="checkbox" class="sr-only peer" ${checked}>
            <div class="w-11 h-6 bg-gray-200 dark:bg-gray-600 rounded-full peer peer-checked:bg-green-500
                        peer-focus:outline-none peer-focus:ring-2 peer-focus:ring-green-400
                        after:content-[''] after:absolute after:top-[2px] after:left-[2px]
                        after:bg-white after:border-gray-300 after:border after:rounded-full
                        after:h-5 after:w-5 after:transition-all peer-checked:after:translate-x-full
                        peer-checked:after:border-white relative"></div>
          </label>
        `;
  },
  cellClick: (e, cell) => {
    const checkbox = e.target.closest("label")?.querySelector("input");
    if (checkbox) {
      const newValue = !checkbox.checked;
      checkbox.checked = newValue;
      cell.setValue(newValue);
    }
  }
}, {
  title: "isNew",
  field: "isNew",
  visible: false
}, {
  title: "Delete",
  field: "delete",
  width: 150,
  formatter: () => `<button class="bg-red-500 hover:bg-red-600 text-white px-2 py-1 rounded transition duration-150">Delete</button>`,
  hozAlign: "center",
  cellClick: (e, cell) => cell.getRow().delete(),
  responsive: 2
}]
